    <title>Presentation sheet</title>
    <style>
        * {
            color: #313030;
            font-family: 'Times New Roman', Times, serif;
            -webkit-margin-start: 0%;
            margin: 0px;
            padding: 0px;
        }

        .main-container {
            height: 1342px;
            position: absolute;
            width: 1040px;
        }

        .image-container {
            position: absolute;
            z-index: -1;
        }

        .image-container > img {
            height: 1342px;
            width: 1040px;
        }

        .block-container {
            display: -webkit-box;
            display: block;
            margin-bottom: 40px;
        }

        .content-container {
            padding-top: 280px;
        }

        .flex-container {
            display: -webkit-box;
            display: flex;
            -webkit-box-pack: justify;
            justify-content: space-between;
            width: 1040px;
            position: absolute;
            padding-left: 20px;
            top: 1080px;
        }

        .negritas {
            display: -webkit-box;
            display: flex;
            font-size: 2.6rem;
            font-weight: bold;
            -webkit-box-pack: center;
            justify-content: center;
        }

        .input {
            display: -webkit-box;
            display: flex;
            font-size: 2rem;
            -webkit-box-pack: center;
            justify-content: center;
        }

    </style>
